import logo from './logo.svg';
import './App.css';
import DateTimePicker from 'react-datetime-picker'
import { useState } from 'react';

function App() {
  const [value, onChange] = useState(new Date(1999,4,21,0,0,0,0));

  return (
    <div className="App">
      <DateTimePicker onChange={onChange} />
    </div>
  );
}

export default App;
